import * as React from 'react';
import "../css/home.css";
import ResponsiveAppBar from '../dynamic/NavBar1.jsx';

function Home(){
return(
    <div id='homeContainer'>
        <ResponsiveAppBar/>
        <div id='contentContainer'>
            <div id = "photoContainer"></div>
            <div id='homeText'>Scoala Gimnaziala nr.10</div>
        </div>
    </div>
);
}

export default Home;
